&lt;p&gt;&lt;strong&gt;Descripci&oacute;n:&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;La&nbsp;AB Swing Family Evolution cuenta con una estructura en hierro de alta resistencia, pintura electrost&aacute;tica, bases y agarres antideslizantes, soporte para discos de 1 a 5 kg. (no incluidos), twister&lt;span&gt;, escalador y dos pares de mancuernas.&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;Caracter&iacute;sticas:&lt;/strong&gt;&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;Peso m&aacute;ximo de usuario 90 Kg.&lt;/li&gt;
&lt;li&gt;Twister, escalador y dos pares de mancuernas.&lt;/li&gt;
&lt;li&gt;Uso: Dom&eacute;stico.&lt;/li&gt;
&lt;li&gt;Color: Gris.&lt;/li&gt;
&lt;li&gt;Referencia: EL02 0084.&lt;/li&gt;
&lt;li&gt;Marca: Evolution.&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;&nbsp;&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;Pol&iacute;ticas de Entrega:&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;Los cargos por servicio a domicilio incluyen s&oacute;lo una entrega; de presentarse alguna situaci&oacute;n que impida entregar la mercanc&iacute;a y &eacute;sta no sea atribuible al proveedor, el cliente asumir&aacute; el costo adicional del nuevo env&iacute;o a su domicilio o en su defecto podr&aacute; recoger los productos en el centro de distribuci&oacute;n principal de la ciudad. Si no hay qui&eacute;n reciba la mercanc&iacute;a a la hora de la entrega, la tripulaci&oacute;n llamar&aacute; a los tel&eacute;fonos de contacto suministrados por el cliente y esperar&aacute; hasta m&aacute;ximo 10 minutos. Es responsabilidad del cliente revisar el estado y funcionamiento de su equipo en el momento de la entrega para firmar a satisfacci&oacute;n y calificar el servicio de entrega. El cliente debe verificar el tama&ntilde;o de las puertas, ascensores y otros accesos al domicilio; en caso de que el equipo no pueda ser ingresado por su tama&ntilde;o, se reprogramar&aacute; la entrega con personal especializado en ensamble; la nueva fecha de entrega estar&aacute; sujeta a la disponibilidad de las partes.&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;Departamentos y ciudades con restricci&oacute;n de flete:&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;San Andr&eacute;s y Providencia, Vaup&eacute;s, Amazonas, Guain&iacute;a, Putumayo, Choc&oacute;, Guaviare y Caquet&aacute;. A estos destinos el flete y la instalaci&oacute;n ser&aacute;n asumidos por el cliente.&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;Tiempos de Entrega:&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;7 d&iacute;as h&aacute;biles seg&uacute;n la ubicaci&oacute;n del producto y del destino de despacho.&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;Garant&iacute;a:&lt;/strong&gt;&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;25 a&ntilde;os de garant&iacute;a en estructura por defectos de f&aacute;brica &uacute;nicamente.&lt;/li&gt;
&lt;li&gt;3 a&ntilde;o de garant&iacute;a en motor, tarjeta y componentes electr&oacute;nicos por defectos de fabrica &uacute;nicamente.&lt;/li&gt;
&lt;li&gt;1 a&ntilde;o de garant&iacute;a en piezas de desgaste.&lt;/li&gt;
&lt;/ul&gt;

